import React from "react"
import Preloader from "../../assetss/common/Loader/Loader";
import {NavLink} from "react-router-dom";
import mwuStyles from "./Messages.module.css"


const MessagesWithUser = (props) => {

/*    const date = props.DialogsMessages.items[0].addedAt.split("T")[0]
    const time = props.DialogsMessages.items[0].addedAt.split("T")[1].split(".")[0]*/


    return <div>

        {props.DialogsMessages ?
            props.DialogsMessages.items.map(item => {
                return(
                    <div key={item.id} className={mwuStyles.Main}>
                        <div>
                                {item.body}
                        </div>

                        <div>
                            <span>
                                &nbsp;
                                Sended at : &nbsp;&nbsp;
                                {props.DialogsMessages.items[0].addedAt.split("T")[0]}
                                &nbsp;  in &nbsp;
                                {props.DialogsMessages.items[0].addedAt.split("T")[1].split(".")[0]}

                            </span>
                        </div>

                        </div>

                )})
            : <Preloader/>
        }
    </div>
}
export default MessagesWithUser
